{"post_stream":{"posts":[{"id":3128896,"name":"","username":"kevskillz","avatar_template":"/letter_avatar_proxy/v4/letter/k/dec6dc/{size}.png","created_at":"2023-01-18T15:23:24.398Z","cooked":"<p>Hello! Our team has been having issues with PathPlanner. We created a simple autonomous path that is supposed to drive One Meter Forward, but we are always receiving 0s for speed in autonomous mode but not teleop. After copying the PPSwerveCommand from PathPlanner to our project and adding some logging to the execute method, we found something very odd.</p>
<pre><code class="lang-auto">if (this.useKinematics) {
      SwerveModuleState[] targetModuleStates =
          this.kinematics.toSwerveModuleStates(targetChassisSpeeds);

          Drivebase.swerveControllerStates = targetModuleStates;
          SmartDashboard.putString(
            "desired target state", targetModuleStates[0].toString());
      this.outputModuleStates.accept(targetModuleStates);
    } else {
      this.outputChassisSpeeds.accept(targetChassisSpeeds);
}
</code></pre>
<p>Here is the method from our Drivebase subsystem we pass in to be <code>outputModuleStates</code>.</p>
<pre><code class="lang-auto">public void setModuleStates(SwerveModuleState[] states) { 
    SmartDashboard.putString(
      "sent target state", states[0].toString());

    mFrontLeftModule.setDesiredState(states[0]);
    mFrontRightModule.setDesiredState(states[1]);
    mBackLeftModule.setDesiredState(states[2]);
    mBackRightModule.setDesiredState(states[3]);
}
</code></pre>
<p>Here, the <code>targetModuleStates</code> contains the correct information (both speed and angle) as  “desired target state” reports, but after it is passed to the Consumer <code>outputModuleStates</code>, the speedMetersPerSecond for each SwerveModuleState becomes 0, and this happens only during autonomous, as <code>setModuleStates</code> “sent target state” reports. The Rotation2d angle information in each SwerveModuleState is always passed correctly, however, which doesn’t make much sense to us. If we put the same One Meter Forward command onto a button and press it in teleop, the <code>targetModuleStates</code> information gets relayed onto <code>outputModuleStates</code> as normal and the robot follows the path.</p>
